import React, { Component } from 'react'
import video  from '../videos/piyanist.mp4' 


 class piyanist extends Component {
    render() {
        return (
            <div>
            <div>
            <video width="750" height="500" controls >
            <source src={video} type="video/mp4"/>
            </video>
            </div>
                
            </div>
        )
    }
}
export default piyanist ;
